import React from "react";

export default function Home(){
    return(
    <header className="w-100">
        <div className="bg-info text-white">
            <h2>Welcome</h2>
            <p>If you're like us, your pets have become family members. When you can't be home for them, whether because of work, vacation or other obligations, you want them taken care of with the same love and attention you give them. That's exactly what we do at Claire's Pooch Sitting. Because we love pets!</p>
            <p className="text-start">Claire's Pooch Sitting offers a multitude of services for a variety of pets. We can also handle various home services which, by making it appear that your house is occupied, can be a crime deterrent. Choose the schedule and services you want, and we'll do the rest.</p>
        </div>
    </header>
    )
}
